import React from 'react';
import Search from './Search'

import './Menu.css';

function Menu(params) {

  
    return(
        <div className="container">
            
                    <h1 className='search title'> Un Mundo de Conocimiento </h1>  
                    <Search onsearch={params.onsearch} />
            
        </div>
       
    );
}

export default Menu;
